import React, { Fragment } from "react";
import Chef from "../../../interfaces/Chef";
import "./HomePage.scss";
import BeigeCard from '../../layout/card/BeigeCard';

interface ChefProps {
  chefs: Chef[];
}

const ChefItem: React.FC<Chef> = ({
  key,
  chefName,
  chefImage,
  chefDescription,
  restaurantName,
  restaurantImage,
}: Chef) => {
  return (
    <Fragment>
      <div className="chef-img">
        <img src={chefImage} alt="yossi"></img>
        <h1>{chefName}</h1>
      </div>
      <p className="description">{chefDescription}</p>
      <p className="chef-left-title">Yossiâ€™s restaurants :</p>
      <BeigeCard img={restaurantImage}>
        <img src={restaurantImage} alt="img"></img>
        <h3>{restaurantName} </h3>
      </BeigeCard>
    </Fragment>
  );
};

const Chefs: React.FC<ChefProps> = ({ chefs }: ChefProps) => {
  return (
    <div>
      {chefs.map((chef) => {
        if (chef.chefName === "Yossi Shitrit") {
          return (
            <ChefItem
              key={chef.key}
              chefName={chef.chefName}
              chefImage={chef.chefImage}
              chefDescription={chef.chefDescription}
              restaurantName={chef.restaurantName}
              restaurantImage={chef.restaurantImage}
            ></ChefItem>
          );
        }
      })}
    </div>
  );
};

export default Chefs;
